import Head from 'next/head'
import MainLAyout from '../components/Mainlayout'

export default function Home() {
  return (
    <MainLAyout>
      <Head>
        
      </Head>

    <main >
    <div class="table-responsive">
    <table class="table table-bordered">
      <thead>
        <tr>
          <th>#</th>
          <th>Firstname</th>
          <th>Lastname</th>
          <th>Age</th>
          <th>City</th>
          <th>Country</th>
          <th>Sex</th>
          <th>Example</th>
          <th>Example</th>
          <th>Example</th>
          <th>Example</th>
          <th>Example</th>
          <th>Example</th>
          <th>Example</th>
          <th>Example</th>
          <th>Example</th>
          <th>Example</th>
          <th>Example</th>
          <th>Example</th>
        </tr>
      </thead>
      <tbody>
        <tr>
          <td>1</td>
          <td>Anna</td>
          <td>Pitt</td>
          <td>35</td>
          <td>New York</td>
          <td>USA</td>
          <td>Female</td>
          <td>Yes</td>
          <td>Yes</td>
          <td>Yes</td>
          <td>Yes</td>
          <td>Yes</td>
          <td>Yes</td>
          <td>Yes</td>
          <td>Yes</td>
          <td>Yes</td>
          <td>Yes</td>
          <td>Yes</td>
          <td>Yes</td>
        </tr>
      </tbody>
    </table>
  
</div>
    </main>

      

      <style jsx>{`
       
       .bookingDetails{
           margin:1rem;
           
       }
        @media screen and (max-width: 700px){
        .bookingDetails{
            
          margin:5px 0px;
        }
        }
       .bookingDetail{
           margin-left:10px;
           padding:30px 10px;
           display:flex;
           width:200px;
           flex-direction:column;
       }
       .bookingLabel{
            margin-left:10px;
            border-bottom:1px solid black;
       }
       .labelText{
           color:blue;   
       }
      

      `}</style>
    </MainLAyout>
  )
}
